import React from 'react';

const ExampleSite = () => {
  return (
    <div className="example-site-container">
      <style jsx>{`
        .example-site-container {
          width: 100%;
          height: 100vh;
          overflow: hidden;
          border: none;
        }

        .example-site-iframe {
          width: 100%;
          height: 100%;
          border: none;
          background: white;
        }
      `}</style>

      <iframe 
        src="/example-site/index.html"
        className="example-site-iframe"
        title="Example Property Management Site"
        sandbox="allow-scripts allow-same-origin allow-forms"
      />
    </div>
  );
};

export default ExampleSite;
